import './index.css'
import { Box, Container, Typography } from "@material-ui/core";

import styled from "styled-components";
import Divider from "@material-ui/core/Divider";
import EngiIcon from '../src/assets/icons/engi.svg'

const App = () => {
  return (
    <Box>
      <Container maxWidth={"xs"}>
        <BoxStlyed>
          <CardStyled>
            <HeaderStyled>
              <Box>
                <img src={EngiIcon} alt='faculty_icon'/>
              </Box>
              <Box >
                <Typography className='title' component='p'>คณะวิศวกรรมศาสตร์</Typography>
                <Typography className='sub-title' component='p'>สาขาวิศวกรรมทั่วไป</Typography>
                <Typography className='caption' component='p'>จุฬาลงกรณ์มหาวิทยาลัย</Typography> 
              </Box>
            </HeaderStyled>
            <Divider />
            <ContentStyled>Content</ContentStyled>
            <Divider />
            <SubContentStyled>SubContent</SubContentStyled>
            <Divider />
            <FooterStyled>Footer</FooterStyled>
          </CardStyled>
        </BoxStlyed>
      </Container>
    </Box>
  );
};

const BoxStlyed = styled(Box)`
  height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const CardStyled = styled(Box)`
  width: 442px;
  // height: 493px;
  border-radius: 5px;
  box-shadow: 0 2px 4px 0 rgba(0, 0, 0, 0.3);
  padding: 20px;
`

const HeaderStyled = styled(Box)`
  padding: 20px 0px;
  display: flex;
  .title { 
    font-family: Prompt;
    font-size: 24px;
    font-weight: 600; 
    color: #ff5a5a;
  }
  .sub-title { 
    font-size: 20px;
    line-height: 0.8;
    font-weight: 500;  
    color: #9b9b9b;
  }
  .caption {
    font-family: Prompt;
    font-size: 20px;
    font-weight: 300; 
    line-height: 0.8; 
    color: #9b9b9b;
    position: absolute;
    bottom: 0px;
  }
`

const ContentStyled = styled(Box)`
  padding: 18px 0px;
`

const SubContentStyled = styled(Box)``;

const FooterStyled = styled(Box)``;

export default App;
